import json
import csv

def split_join(str):
    s = str.split(',')
    return s[0]+s[1]
def get_values(outputs):
    dic = dict()
    for output in outputs:
        for out in output:
            data = json.loads(out)
            t1, t2, t3, t4 = data['orig_timestamp'], data['recv_timestamp'], data['tx_timestamp'], data['tx_timestamp']
            if 't1' not in dic:
                dic['t1'] = [t1]
            else:
                dic['t1'] += [t1]
            if 't2' not in dic:
                dic['t2'] = [t2]
            else:
                dic['t2'] += [t2]
            if 't3' not in dic:
                dic['t3'] = [t3]
            else:
                dic['t3'] += [t3]
            if 't4' not in dic:
                dic['t4'] = [t4]
            else:
                dic['t4'] += [t4]

    with open('test.csv', 'w') as f:
        f.write("index, t1, t2, t3, t4 \n")
        for index in range(len(dic['t1'])):
            f.write(" %s, %s, %s, %s, %s \n"%(index, split_join(dic['t1'][index]),
                                              split_join(dic['t2'][index]),
                                              split_join(dic['t3'][index]),
                                              split_join(dic['t4'][index])))
    return dic

